    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 * - ( - col0 ) BETWEEN ( + CAST ( col0 AS REAL ) ) + - col2 AND ( col2 );
  - name: tab0

outputs:
  - name: q610.out
    data: |
      15	81	47
      87	21	10
      97	1	99
